import React, { createContext } from 'react';
import MathOperation from '../Components/MathOperation';

export const ContextPage = createContext();

export default function ContextProvider(props) {

    const codeBlocks = [
        { title: 'Math Operation', component: <MathOperation/> },
        { title: ''}
    ];

  return (
    <ContextPage.Provider value={{ codeBlocks }}>
        {props.children}
    </ContextPage.Provider>
  )
}
